import {BurgerWrapper} from './burgerstyled'

import {BurgerContext} from '../../context/burgerContext'

export default function Index({text, onClick, ...props}) {
    const {burger, setBurger} = useContext(BurgerContext)

    return (
        <BurgerWrapper onClick={onClick}>
            {burger}
        </BurgerWrapper>
    )
}
